This new edition of a well-established textbook has been enriched by the addition of a large number of new photomicrographs of human tissues. The text has also been fully updated and the layout redesigned. High-quality slides are arranged in groups based on similarity of appearanceto aid accurate identification. For medical and biomedical science students, students of anatomy, human physiology and dentistry. This new edition of a well-established textbook has been enriched by the addition of a large number of new photomicrographs of human tissues. The text has also been fully updated and the layout redesigned. High-quality slides are arranged in groups based on similarity of appearanceto aid accurate identification. For medical and biomedical science students, students of anatomy, human physiology and dentistry.

